sourcesContent:
import pool from "../configs/connectDB"
let GetAllUser = async(req,res)=>{
    const [rows, fields] = await pool.execute('SELECT * FROM `table1` ');
    return res.status(200).json({
        message:'Ok',
        data :rows
    });
}
let CreateNewUser = async(req,res)=>{
    let{Hoten,Ngaysinh,Nghenghiep,Phone,Email} = req.body;
    if(!Hoten||!Nghenghiep){
        return res.status(200).json({
        message:'Missing required params',
    });
    }
    await pool.execute('insert into table1 (Hoten,Ngaysinh,Nghenghiep,Phone,Email) values (?,?,?,?,?)',
    [Hoten,Ngaysinh,Nghenghiep,Phone,Email]);
    return res.status(200).json({
        message:'Create success',
    });
}
let UpdateUser = async(req,res)=>{
    let{id,Hoten,Ngaysinh,Nghenghiep,Phone,Email} = req.body;
    console.log(id)
    if(!id||!Hoten||!Nghenghiep){
        return res.status(200).json({
        message:'Missing required params',
    });
    }
    await pool.execute(`update table1 set Hoten = ?,Ngaysinh = ?,Nghenghiep = ?,Phone =?,Email = ? where Maso = ?`,
        [Hoten,Ngaysinh,Nghenghiep,Phone,Email,id]);
    return res.status(200).json({
        message:'Update success'
    });
}
let DeleteUser = async(req,res)=>{
    let id = req.params.id;
    if(!id){
        return res.status(200).json({
        message:'Missing required params',
    });
}
    await pool.execute(`DELETE FROM table1 WHERE Maso = "${id}"`);
    return res.status(200).json({
        message:'Delete success '+id
    });
}
export default{
    GetAllUser,
    CreateNewUser,
    UpdateUser,
    DeleteUser
}

